PRINT N'Creating [dbo].[vw_NewBreedNightly]...';


GO
create view vw_NewBreedNightly
as
select top 10000 GuestID, PseudoID, t1.*
from (
select ParkDate, parkName, longname, FacilityID = FacilityName, readerLocation, EventTypeName, LocalDateTime = MAX(LocalDateTime)
	from 
(select top 10000 ParkDate = convert(date, DATEADD(HH,-4,TimeStamp)), 
	LocalDateTime = DATEADD(HH,-4,TimeStamp), 
	LocalTime = CONVERT(time,DATEADD(HH,-4,TimeStamp)), 
	e1.*,x.longname, EventTypeName, parkName, FacilityName
	from FPReaderTestActivityEvent as e1
	join rdr.EventType e2 on e1.EventTypeID = e2.EventTypeID
	join rdr.facility f1 on e1.FacilityID = f1.FacilityID
	left join dbo.xiFacilities x on x.FacilityID = f1.FacilityName
	where CONVERT(time,DATEADD(HH,-4,TimeStamp)) between '00:00:00.000'  and '07:00:00.000'
	order by 1,2 desc) as t1
	where xPass = 1 and ParkDate >= convert(date,getdate())
group by ParkDate, parkName, longname, readerLocation, EventTypeName, FacilityName) as t1
join
	(select top 10000 ParkDate = convert(date, DATEADD(HH,-4,TimeStamp)), 
	LocalDateTime = DATEADD(HH,-4,TimeStamp), 
	LocalTime = CONVERT(time,DATEADD(HH,-4,TimeStamp)), 
	e1.*,x.longname, EventTypeName, parkName, FacilityName, PseudoID = replace(replace(t4.guestid,'?SecureID=',''),'?PublicID=','')
	from FPReaderTestActivityEvent e1
	left join (select  EventId 
		,pref.value('(guestid/text())[1]', 'nvarchar(128)') as guestid
        ,pref.value('(publicid/text())[1]', 'nvarchar(128)') as publicid
		from FPReaderTestActivityEvent as t3
		cross apply RawMessage.nodes('/venue/message') as nodeData(pref)
		where CONVERT(time,DATEADD(HH,-4,TimeStamp)) between '00:00:00.000'  and '07:00:00.000') as t4 on e1.eventid = t4.eventid  
	join rdr.EventType e2 on e1.EventTypeID = e2.EventTypeID
	join rdr.facility f1 on e1.FacilityID = f1.FacilityID
	left join dbo.xiFacilities x on x.FacilityID = f1.FacilityName
	where CONVERT(time,DATEADD(HH,-4,TimeStamp)) between '00:00:00.000'  and '07:00:00.000'
	order by 1,2 desc) as t2 on t1.LocalDateTime = t2.LocalDateTime
	and t1.FacilityID = t2.FacilityName 
	and t1.readerLocation = t2.readerLocation 
	and t1.EventTypeName = t2.EventTypeName 
order by 3,4,5,9
