create procedure sp_insert_PublicID_GxpLinkID_xRef
@PublicID bigint,
@GXPLinkID bigint
as 
begin
MERGE PublicID_GxpLinkID_xRef as TARGET
USING (select PublicID = @PublicID, GXPLinkID = @GXPLinkID) AS SOURCE
on (TARGET.PublicID = SOURCE.PublicID
	and TARGET.GXPLinkID = SOURCE.GXPLinkID)
WHEN MATCHED 
	THEN UPDATE 
	SET 
	TARGET.PublicID = SOURCE.PublicID
	,TARGET.GXPLinkID = SOURCE.GXPLinkID
WHEN NOT MATCHED BY TARGET
	THEN INSERT (PublicID,GXPLinkID)
	VALUES(SOURCE.PublicID,SOURCE.GXPLinkID);
end
