select x.parkFacilityID, x.FacilityID, EventCount = count(t.facilityId), 
	EntryFlag = isnull(SUM(EntryFlag),0),
	AbandonFlag = isnull(SUM(AbandonFlag),0),
	MergeFlag = isnull(SUM(MergeFlag),0),
