CREATE procedure [dbo].[usp_LocationTieOut_ETL] 
@parkID bigint

as

select v1.FacilityID, v1.TimeSliceBeg, v1.TimeSliceEnd,-- count(*), 
	EntryFlag = convert(decimal (6,3), ISNULL(SUM(EntryFlag)*1.0/count(*)*1.0,-1)),
	AbandonFlag = convert(decimal (6,3), ISNULL(SUM(AbandonFlag)*1.0/count(*)*1.0,-1)),
	MergeFlag = convert(decimal (6,3), ISNULL(SUM(MergeFlag)*1.0/count(*)*1.0,-1)),
	VBAFlag = convert(decimal (6,3), ISNULL(SUM(VBAFlag)*1.0/count(*)*1.0,-1)),
	LoadTime = convert(decimal (6,3), ISNULL(SUM(LoadTime)*1.0/count(*)*1.0,-1)),
	ExitFlag = convert(decimal (6,3), ISNULL(SUM(ExitFlag)*1.0/count(*)*1.0,-1))
	from vw_FacilitySlice15Mins v1
	left join vw_TieOutBase v2 on v1.FacilityID = v2.FacilityID and v1.TimeSliceBeg = v2.TimeSliceBeg --and ExitFlag = 1
	join xiFacilities x on x.facilityId = v1.FacilityID and parkFacilityID = @parkID
	where v1.TimeSliceBeg between '08:00:00.0000000' and '22:45:00.0000000'
	group by v1.FacilityID, v1.TimeSliceBeg, v1.TimeSliceEnd
	order by 1, 2, 3
